var projectDetail={boat:{desc:"This picture was taken from the northern end of the Golden Gate Bridge in San Francisco, CA",title:"Boat Project",image:"dist/images/boat-featured-600_medium.jpg",imageAlt:"Boat Image"},peacock:{desc:"This picture was taken from the northern end of the Golden Gate Bridge in San Francisco, CA",title:"Peacock Project",image:"dist/images/peacock-featured-600_medium.jpg",imageAlt:"Peacock Image"},flower:{desc:"This picture was taken from the northern end of the Golden Gate Bridge in San Francisco, CA",title:"Flower Project",image:"dist/images/flowers-featured-600_medium.jpg",imageAlt:"Flower Image"}};$(".featured").on("click",function(a){var b=$(a.target),c=b.closest("img").data("project-name"),d=projectDetail[c],e='<div><img class="img-responsive" src="'+d.image+'" alt="'+d.imageAlt+'">'+d.desc+"</div>";BootstrapDialog.show({title:d.title,message:e,buttons:[{label:"Close",cssClass:"btn btn-default",action:function(a){a.close()}}]})});